import React, { useState, useEffect } from 'react';

// pakges ui
import { AppBar, Toolbar, Typography, Avatar, Button } from '@material-ui/core';
import { Link } from 'react-router-dom';

// style
import useStyles from './Styles'

// images
import memories from '../../images/memories.png';

const Navbar = () => {
    // .name.charAt(0)
    const classes = useStyles();
    const [user, setUser] = useState(JSON.parse(localStorage.getItem('profile')));
    console.log(user);
    return (
        <AppBar className={classes.appBar} position="static" color="inherit">
            <div className={classes.brandContainer}>
                <Typography component={Link} to='/' className={classes.heading} variant="h2" align="center">Memories</Typography>
                <img className={classes.image} src={memories} alt="icon" height="60" />
            </div>
            <Toolbar>
                {user ?
                    (
                        <div className={classes.profile}>
                            <Avatar className={classes.purple} alt={user.result.name} src={user.result.imageUrl}>{user.result.imageUrl}</Avatar>
                            <Typography className={classes.userName} variant='h6'>{user.result.name}</Typography>
                            <Button variant="contained" className={classes.logout} color="secondary"></Button>
                        </div>
                    )
                    :
                    (
                        <Button variant='contained' component={Link} to='/auth' color='primary'> Sign In</Button>
                    )
                }
            </Toolbar>
        </AppBar>

    );
}

export default Navbar;
